Проект (от латинского projectus-буквально: брошенный вперед)
a) Совокупность документов (расчетов, чертежей) для создания какого либо
сооружения или изделия;
b) Предварительный текст документа;
c) Замысел, план, прототип, прообраз какого либо объекта;
Объект проектирования
a) Предвидимый объект;
b) Некая система, которая будет и которая должна заполнить функциональную
нишу во внешней среде;
c) Конструируемый идеальный объект, чье качество меняется от одной стадии
проектирования к другой стадии проектирования;
d) Развивающаяся «модель будущего» ;
e) Объект проектирования есть «процесс проектирования объекта», то есть
система получения взаимосвязанных проектных решений (ПР) – моделей
будущего;
f) Объект проектирования раскрывается в логической схеме проектирования
(ЛСП) через систему проектных решений;
g) Объектом проектирования является жизненный цикл; жизненный цикл как
структурно-процессуальный срез объекта проектирования оказывается тождественным самому объекту;
h) Объект проектирования есть перевод цели в результат (процесс трансформаций исходных данных в результат) ;
i) Объектом проектирования является информация об объекте проектирования, информационная модель объекта;
